import React, { useState } from "react";

import { Form, Button } from "react-bootstrap";
import "./FilterEvents.css";
const FilterEvents = (props) => {
  const [filterItems, setFilterItems] = useState(props.eventsList);

  const filterSportHandler = (e) => {
    console.log(e.target.value);
  };
  const filterLevelHandler = (e) => {
    console.log(e.target.value);
  };

  return (
    <div className="selectForm">
      <div className="text-center">
        <h5>Filter Events</h5>
      </div>
      <div onChange={filterSportHandler}>
        <Form.Label>Filter by sport</Form.Label>
        <Form.Select id="selectFilter" aria-label="Default select example" place>
          <option></option>
          <option value="Tennis">Tennis</option>
          <option value="Football">Football</option>
          <option value="Badminton">badminton</option>
          <option value="Volley">Volley</option>
          <option value="Jogging">Jogging</option>
        </Form.Select>
      </div>
      <div onChange={filterLevelHandler}>
        <Form.Label>Filter by Level</Form.Label>
        <Form.Select id="selectFilter" aria-label="Default select example">
          <option></option>
          <option value="Beginner">Beginner</option>
          <option value="Intermediate">Intermediate</option>
          <option value="Pro">Pro</option>
        </Form.Select>
      </div>
    </div>
  );
};

export default FilterEvents;
